import React from 'react';
import Tooltip from '@atlaskit/tooltip';
import Select, { components } from 'react-select';
 const colourOptions = [

  ];

const Input = props => {

  if (props.isHidden) {
    return <components.Input {...props} />;
  }
  return (
    <div >
      <Tooltip content={'Custom Input'}>
        <components.Input {...props} />
      </Tooltip>
    </div>
  );
};

const onChange=(event)=>{
  console.log("Data:", event);

}

export default (props) => {
  console.log("in custom", props.departmentsFieldValue, props.selectedDepartments);

  return(
  <Select
    value={props.selectedDepartments}
    closeMenuOnSelect={false}
    components={{ Input }}
    isMulti
    options={props.departmentsFieldValue}
    placeholder={'Departments'}
    onChange={props.onChange}

    // defaultValue={props.departmentsFieldValue}
    id={props.departmentsFieldId}
  />
)};
